import { useState } from "react";

const SearchBar = () => {
  const [searchQuery, setSearchQuery] = useState("");

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  return (
    <div>
      <input
        onChange={handleSearchChange}
        type="text"
        name="search"
        placeholder="Search"
        value={searchQuery}
        id=""
      />
    </div>
  );
};

export default SearchBar;
